import React, { useState } from "react";
import Layout from "../../components/layout";
import styles from "./style.module.css";
import ChangeImage from "../../assets/image/Screenshot_2023-05-13-15-00-01-730_com.whatsapp.jpg";
import Button from "@mui/material/Button";

const SettingsPage = () => {
  const [activeTab, setActiveTab] = useState("profil");
  const [click, setClick] = useState(false);
  const handleClick = () => {
    setClick(!click);
  };

  return (
    <Layout>
      <div className={styles.SettingsPage}>
        <div className={styles.LeftLine}>
          <div className={styles.Left}>
            <span className={styles.SettingsText}>Ayarlar</span>
            <span
              onClick={() => {
                setActiveTab("profil");
                handleClick();
              }}
              className={`styles.ProfilSettings ${click ? "active" : ""} `}
            >
              Profil ayarları
            </span>
            <span
              onClick={() => {
                setActiveTab("hesap");
              }}
              className={styles.AccountSettings}
            >
              Hesap ayarları
            </span>
            <span
              onClick={() => {
                setActiveTab("profil");
              }}
              className={styles.Exit}
            >
              Çıkış yap{" "}
            </span>
          </div>

          <div>
            <hr className={styles.Line} />
          </div>
        </div>

        <div className={styles.Right}>
          {activeTab === "profil" && (
            <div className={styles.ProfileSettingsBox}>
              <span className={styles.ProfilSettingsText}>
                Profil Ayarları{" "}
              </span>
              <div className={styles.ProfileSettings}>
                <img className={styles.ImageChange} src={ChangeImage} alt="" />
                <div className={styles.ProfileButton}>
                  <Button variant="contained">Değiştir </Button>
                  <Button variant="outlined"> Sil </Button>
                </div>
              </div>

              <div className={styles.NameSurnameInput}>
                <div className={styles.NameSurnameInput0}>
                  <span className={styles.InputText}>Yeni isim</span>
                  <input className={styles.Input} type="text" />
                </div>
                <div className={styles.NameSurnameInput0}>
                  <span className={styles.InputText}>Yeni soyisim</span>
                  <input className={styles.Input} type="text" />
                </div>
              </div>
            </div>
          )}

          {activeTab === "hesap" && (
            <div className={styles.AccountSettingsBox}>
              <div>
                <span>mail değiştir</span> <input type="text" />
              </div>
              <div>
                <span>şifre değiştir</span> <input type="text" />
              </div>
            </div>
          )}
        </div>
      </div>
    </Layout>
  );
};

export default SettingsPage;
